import React from 'react';
import styles from './Book7Anim.module.css';
import { Link } from 'react-router-dom';

const Book7 = () => {
    return (
        <div id="card">
            <div class={styles.container}>
                <p>Wonder</p>
                <div class={styles.door7}></div>
                <Link to={'/wonder/new'}></Link>
            </div>
        </div>
    );
};

export default Book7;
